
const fn = (arr) => {
  return arr.reduce((o, item) => {
    if (item.cities && !item.states) o = o.concat(item.cities.map(x => ({ code: item.code, country: item.country, city: x.city, timeZone: x.timeZone })))
    else if (item.states) o = o.concat(...item.states.map(x => x.cities.map(y => ({ code: item.code, country: item.country, state: x.state, city: y.city, timeZone: y.timeZone }))))
    return o
  }, [])
}

